import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import { Card, Button, Container, Row } from "react-bootstrap";

const RecipeList = () => {
	// Previous code...

	return (
		<Container className='d-flex justify-content-center align-items-center'>
			<Button
				onClick={handlePrev}
				disabled={currentIndex === 0}>
				Previous
			</Button>
			<Card
				className='mx-2 shadow'
				style={{ width: "30rem", height: "35rem", backgroundColor: "#f8f9fa" }}>
				<Card.Img
					variant='top'
					src={recipe.recipe.image}
					style={{ maxHeight: "200px", objectFit: "cover" }}
				/>
				<Card.Body className='d-flex flex-column justify-content-between'>
					<Card.Title>{recipe.recipe.label}</Card.Title>
					<Card.Text>
						<ul>
							{recipe.recipe.ingredientLines.map((ingredient, i) => (
								<li key={i}>{ingredient}</li>
							))}
						</ul>
						<div className='text-center'>
							<Row>
								<div className='col'>
									<strong>Energy:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.ENERC_KCAL?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.ENERC_KCAL?.unit}
								</div>
								<div className='col'>
									<strong>Fat:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.FAT?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.FAT?.unit}
								</div>
							</Row>
							<Row>
								<div className='col'>
									<strong>Carbs:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.CHOCDF?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.CHOCDF?.unit}
								</div>
								<div className='col'>
									<strong>Protein:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.PROCNT?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.PROCNT?.unit}
								</div>
							</Row>
						</div>
					</Card.Text>
				</Card.Body>
			</Card>
			<Button
				onClick={handleNext}
				disabled={currentIndex === recipes.length - 1}>
				Next
			</Button>
		</Container>
	);
};

export default RecipeList;
